    private function getNextRank()
    {
        static $rank = null;
        // if ($rank === null) {
        //     $maxrank = DB::table('admin')
        //     ->select(DB::raw('MAX(rank) as max_rank'))
        //     ->union(DB::table('users')->select('rank'))
        //     ->max('max_rank');
        //     if (is_null($maxRank)){
        //         $rank = 1;
        //     }
        //     else{
        //         $rank = $maxrank;
        //     }
        // } else{
        //     $rank++;
        // }

        if ($rank === null) {
            $highestRankinAdmin = Admin::max('Rank');
            $highestRankinUsers = Users::max('Rank');
    
            if ($highestRankinAdmin === null && $highestRankinUsers === null) {
                $rank = 1;
            } elseif ($highestRankinAdmin !== null || $highestRankinUsers !== null) {
                $rank = max($highestRankinAdmin, $highestRankinUsers) + 1;
            }
        } else {
            $rank++;
        }
        return $rank;
    }
